function Home(){

    const token = useContext(UlogCtx);

    function isUserLoggedIn(){
        if(token !=""){
            return true;
        }
    }

    return(
        <div className="homeContainer">
           {/* <h1> page d'accueil üè† </h1> */}
           <Nav />
           <NewMessage isLoggedIn={isUserLoggedIn} /> 
        </div>
    )

}

export default Home
